import React from "react";

function Navi(props){
    return(
        <div>
            fist name:{props.fname}<br/>
            last name:{props.lname}<br/>
            age:{props.age}<br></br>
            city:{props.city}<br/>

        </div>
    )
}
export default Navi;

function Navi1(){
    return(
        <div>
            <Navi fname="naveeen" lname="yakkaluru" age="25" city="bengaluru" />

        </div>
    )
}
